templeMap::templeMap()
{
	Init();
	DrawOwnScn();
}

templeMap::~templeMap()
{
}

void templeMap::Update(Vector2 offset)
{	
	mOffset = { offset.x_,offset.y_ };
}

void templeMap::DrawOwnScn()
{
	DrawBox(0, 0, 1080, 609, 0x0000ff, true);
	for (int x = 0; x < MAP_X; x++)
	{
		for (int y = 0; y < MAP_Y; y++)
		{
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[tsoil[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[pillar[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[temple[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[wall[y][x]], true);
			DrawGraph(32 * x - mOffset.x_, 32 * y - mOffset.y_, mChipImage[tobj1[y][x]], true);
			//DrawFormatString(32 * x - mOffset.x_, 32 * y - mOffset.y_, GetColor(0, 0, 255), "%d", tsoil[y][x]);

		}
	}
}

bool templeMap::Init(void)
{
	if (LoadDivGraph("./image/map.png", 2800, 56, 50, 32, 32, &mChipImage[0]) == -1)
	{
		return false;
	}
	return true;
}

